func xyyxbase64DeocdedToImage(base64:String) -> UIImage? {
    
    if let xyyxdataDecoded = Data(base64Encoded: base64, options: Data.Base64DecodingOptions.init()) {
        if let xyyxdecodedimage = UIImage(data: xyyxdataDecoded) {
            return xyyxdecodedimage
        }
    }
    
    return nil
}
